import React, { Component } from 'react';

class Header extends Component {
    render() { 
        return ( 
            <header className="container-fluid row col-md-12">
                <div className="row">
                    <button className="btn btn-dark mt-3 ml-3 float-left">Battle</button>

                    <div className="float-right mt-3 mr-3">
                        <button className="btn btn-dark mr-3">Followers</button>
                        <button className="btn btn-dark mr-3">Repositories</button>

                        <button className="btn btn-dark mr-3">JavaScript</button>
                        <button className="btn btn-dark mr-3">Java</button>
                        <button className="btn btn-dark mr-3">Python</button>
                        <button className="btn btn-dark ">PHP</button>
                    </div>
                </div>
            </header>
         );
    }
}

export default Header;
